pragma solidity ^0.5.0;

import "../external/Owned.sol";
import "../external/ListLib.sol";
import "../Interfaces.sol";

/// @title PaymentDelegate Contract
/// @author Joseph Reed
/// @dev The PaymentDelegate handles executing payments on a delegated wallet. Only the owner can schedule payments
contract PaymentDelegate is Owned {

    using ListLib for ListLib.AddressList;  // Import the data structure AddressList from the ListLib contract

    uint public blockCreated;               // The block the payment delegate was deployed
    
    mapping (address => ListLib.AddressList) payments;  // The list of active alarm clocks for each account

    /// @notice Initializes the payment delegate.
    /// @param _owner The address with permission to schedule payments
    constructor (address _owner) public {
        require(blockCreated == 0, "block created can only be set once");

        blockCreated = block.number;
        
        owner = _owner;
    }

    /// @notice Executes the payment associated with the address of 'msg.sender'
    /// @return True if the payment executed successfully
    function execute () public returns (bool success) {
        IPayment payment = IPayment(msg.sender);
        address wallet = address(payment.wallet());
        require(payments[wallet].contains(address(payment)), "payment does not exist in the wallet payment list");

        uint paymentAmount = payment.amount();
        success = payment.wallet().transfer(
            payment.token(), 
            payment.recipient(),
            paymentAmount
        );

        emit Payment_event(payment, paymentAmount, success);
    }

    /// @notice Schedules a payment. Only callable by a trusted payment scheduler
    /// @param payment The payment contract responsible for holding logic and data about the payment
    function schedule (IPayment payment) public onlyOwner {
        address wallet = address(payment.wallet());
        payments[wallet].add(address(payment));

        emit Schedule_event(payment, wallet);
    }

    /// @notice Unschedules a payment. Only callable by a delegate of the wallet supplied with the payment
    /// @param payment The payment contract responsible for holding logic and data about the payment
    function unschedule (IPayment payment) public {
        require(payment.wallet().isDelegate(msg.sender), "only a delegate can unschedule a payment");

        remove(payment);
    }

    /// @notice Unschedules a payment. Only callable by the payment contract
    function unschedule () public {
        IPayment payment = IPayment(msg.sender);
        remove(payment);
    }
    
    /// @notice Fetches the payments of a given wallet
    /// @param wallet The account to search
    /// @return The list of payments associated with the 'wallet'
    function getPayments (address wallet) public view returns (address[] memory) {
        return payments[wallet].get();
    }
    
    /// @notice Fetches the total number of payments of a given wallet
    /// @param wallet The account for which we are fetching the number of payment
    /// @return The number of payments associated with the 'wallet'
    function getTotalPayments (address wallet) public view returns (uint) {
        return payments[wallet].getLength();
    }

    /// @notice Fetches the payments of a given wallet at a given index
    /// @param wallet The account to search
    /// @param i The index of the payment to fetch
    /// @return The payment at index 'i'
    function getPaymentAtIndex (address wallet, uint i) public view returns (address) {
        return payments[wallet].index(i);
    }

    /// @notice Indicated whether an account currently is associated with an outgoing payment
    /// @param wallet The account to search
    /// @param payment The payment to check for
    /// @return True if the given 'wallet' contains the given 'payment'
    function walletContainsPayment (address wallet, IPayment payment) public view returns (bool) {
        return payments[wallet].contains(address(payment));
    }

    /// @notice An internal function used for removing a payment from a wallet
    /// @param payment The payment to remove from the payment wallet
    function remove (IPayment payment) internal {
        address wallet = address(payment.wallet());
        if(payments[wallet].remove(address(payment)))
            emit Unschedule_event(payment, address(payment));
    }
    
    event Payment_event (IPayment indexed payment, uint amount, bool success);
    event Schedule_event (IPayment payment, address indexed wallet);
    event Unschedule_event (IPayment payment, address indexed caller);

}
